export default function Register() {
  return (
    <div className="flex justify-center items-center h-[100vh] w-[100wh]  ">
      <div className="text-[#EFEFEF] text-[28px] text-center mb-7">
        Запись на
        <br /> обслуживание
      </div>
    </div>
  );
}
